import React, { useState } from 'react';
import './NavBar.css';

const NavBar: React.FC = () => {
    const [isOpen, setIsOpen] = useState(false);

    const toggleMenu = () => {
        setIsOpen(!isOpen);
    };

    return (
        
        <nav className="navbar">
        
            <div className="hamburger" onClick={toggleMenu}>
                &#9776;
            </div>

            <div>
            <NavBar />
            <h1>Web-Based Monitoring Interface</h1>
            <MonitoringDashboard />
            </div>

            <ul className={`navbar-list ${isOpen ? 'open' : ''}`}>
                <li className="navbar-item"><a href="#smart">SMART</a></li>
                <li className="navbar-item"><a href="#dito">DITO</a></li>
                <li className="navbar-item"><a href="#globe">GLOBE</a></li>
            </ul>
        </nav>
    );
};

export default NavBar;
